(function () {
    // localStorage isGetPermission
    // localStorage getTokenTime
    let div = document.createElement("div")
    div.setAttribute("id", "inserted")
    div.innerHTML = `
    <div id="myPanel">
        <div class="panelItem">
            <div style="padding:5px;">
                提示：
                <span class="tipContent">请稍等...</span>
            </div>
            <div class="getPermission spinner spinner__1">
                <span class="kai">解</span>
            </div>
        </div>
        <div class="panelItem">
            <div class="money">
                <div>
                    &nbsp;&nbsp;&nbsp;&nbsp;创作不易，请我喝一瓶水吧，谢谢啦！支付宝哦~！
                </div>
                <img style="width: 90%;margin: 10px auto 0;" src="data:image/jpg;base64," alt="">
            </div>
        </div>
        <span class="bottomBtn">获取权限</span>
        <span class="bottomBtn">打赏作者</span>
    </div>
    `
    let style = document.createElement("style")
    style.innerHTML = `
    #myPanel {
            width: 200px;
            height: 300px;
            overflow: hidden;
            position: relative;
            background-color: black;
            border-radius: 12px;
            box-shadow: 0px 0px 10px 2px #990033;
        }
        .panelItem {
            border-radius: 10px;
            background-color: black;
            color: white;
            width: 200px;
            height: 300px;
            display: inline-block;
            position: absolute;
            left: 0;
            top: 0;
            transition: all .6s cubic-bezier(.17,.67,.63,1.59);
        }
        #myPanel>:nth-child(2) {
            transform: translateX(100%);
        }
        #myPanel>span {
            position: absolute;
            bottom: 0;
            width: 99px;
            background-color: black;
            text-align: center;
            height: 40px;
            display: inline-block;
            line-height: 40px;
            font-size: 17px;
            color: white;
            cursor: pointer;
        }
        #myPanel>span:nth-child(3) {
            left: 0;
            border-radius:0 0 0 10px;
        }
        #myPanel>span:last-child {
            right: 0;
            border-radius:0 0 10px 0;
        }
        .grayBg {
            background-color: gray !important;
        }
        .money {
            padding: 10px;
            display: flex;
            flex-direction: column;
        }
        .spinner {
            width: 70px;
            height: 70px;
            background: #eee;
            border-radius: 50%;
            position: relative;
            display: inline-block;
            position: relative;
            left: 50%;
            top: 50%;
            transform: translate(-50%,-120%);
            cursor: pointer;
        }
.spinner:after,
.spinner:before {
    content: "";
    display: block;
    width: 70px;
    height: 70px;
    border-radius: 50%;
}
.spinner__1::after {
    position: absolute;
    border: 4px solid transparent;
    border-top-color: #990033;
    border-bottom-color: #990033;
    top: -4px;
    left: -4px;
    animation: spin 2s linear infinite;
}
.spinner__1::before {
    position: absolute;
    top: 17px;
    left: 17px;
    height: 35px;
    width: 35px;
    /* background-color: #1ABC9C; */
    background-color: #990033;
    animation: shrink 3s ease infinite;
}
@keyframes spin {
    0% {
        transform: rotate(0deg) scale(1);
    }
    50% {
        transform: rotate(180deg) scale(1.4);
    }
    100% {
        transform: rotate(360deg) scale(1);
    }
}
@keyframes shrink {
    0% {
        transform: scale(1);
    }
    50% {
        transform: scale(1.6);
    }
    100% {
        transform: scale(1);
    }
}
.kai {
    position: absolute;
    left: 50%;
    top: 50%;
    transform: translate(-50%,-50%);
    color: white;
}
#inserted {
    position: absolute;
    left: 20px;
    top: 20px;
    z-index: 1000;
}
    `
    document.getElementsByTagName("head")[0].appendChild(style)
    document.getElementsByTagName("body")[0].appendChild(div)
    let currentButton = 0
    let btns = document.getElementsByClassName("bottomBtn")
    let tabs = document.getElementsByClassName("panelItem")
    function changeActiveBtn() {
        if (currentButton === 0) {
            btns[1].className = "bottomBtn grayBg"
            btns[0].className = "bottomBtn"
            translateToRight()
        } else {
            btns[0].className = "bottomBtn grayBg"
            btns[1].className = "bottomBtn"
            translateToLeft()
        }
    }
    function translateToLeft() {
        tabs[0].style.transform = "translateX(-100%)"
        tabs[1].style.transform = "translateX(0%)"
    }
    function translateToRight() {
        tabs[0].style.transform = "translateX(0%)"
        tabs[1].style.transform = "translateX(100%)"
    }
    function isGetPermission() {
        if (window.localStorage.getItem("isGetPermission") == "true") {
            document.getElementsByClassName("tipContent")[0].innerHTML = "已获取权限"
            let getTokenTimestamp = window.localStorage.getItem("getTokenTime")
            let nowTimestamp = new Date().getTime()
            //
            let hasGoneTimestamp = nowTimestamp - getTokenTimestamp
            let hasGoneSeconds = hasGoneTimestamp * 1000
            if (hasGoneSeconds > 12 * 60 * 60) {
                document.getElementsByClassName("tipContent")[0].innerHTML = "权限可能过期"
            }
        } else {
            document.getElementsByClassName("tipContent")[0].innerHTML = "未获取权限"
        }
    }
    function saveToken (token) {
        let local = JSON.parse(
            window.localStorage.getItem("newPCVideoNoLiveStore")
          )
          local.userToken = token
          setTimeout(function () {
            window.localStorage.setItem(
              "newPCVideoNoLiveStore",
              JSON.stringify(local)
            )
          }, 5000)
    }
    function getHttpsToken() {
        document.getElementsByClassName("tipContent")[0].innerHTML = "获取权限中..."
        let xmlhttp = new XMLHttpRequest()
        xmlhttp.onreadystatechange = function () {
            if (xmlhttp.readyState == 4 && xmlhttp.status == 200) {
            let res = JSON.parse(xmlhttp.response)
            console.log("服务器返回的数据：",res)
            if (res.isGetToken) {
                saveToken(res.token)
                console.log("获取token成功")
                document.getElementsByClassName("tipContent")[0].innerHTML = "获取权限成功"
                window.localStorage.setItem("isGetPermission", true)
                window.localStorage.setItem("getTokenTime", res.getTokenTime)
            } else {
                console.log("获取token失败")
                document.getElementsByClassName("tipContent")[0].innerHTML = "获取权限失败，请重试"
            }
            } else if (xmlhttp.readyState == 4 && xmlhttp.status != 200) {
                console.log("服务器出错")
                document.getElementsByClassName("tipContent")[0].innerHTML = "服务器出错，请重试"
            }
        }
        xmlhttp.open("GET", "https://45.76.196.170:5000/getPermission", true)
        xmlhttp.send()
    }
    function getPermission() {
        getHttpsToken()
    }
    function isLogin() {
        let isLogin = setInterval(function(){
            let local = JSON.parse(window.localStorage.getItem("newPCVideoNoLiveStore"))
            if (local != null) {
                if (local.isLogin === true || local.isLogin === "true") {
                    document.getElementsByClassName("rightArea")[0].remove()
                    console.log("isLogin")
                    isGetPermission()
                    clearInterval(isLogin)
                } else {
                    document.getElementsByClassName("tipContent")[0].innerHTML = "请先登录...."
                }
            }
        },500)
    }
    function main() {
        for (let i = 0; i < 2; i++) {
            btns[i].addEventListener("click", function (e) {
                currentButton = i
                // document.getElementById("video").play()
                changeActiveBtn()
            })
        }
        document.getElementsByClassName("getPermission")[0].addEventListener("click", function() {
            if (document.getElementsByClassName("tipContent")[0].innerHTML == "获取权限成功" ||
                document.getElementsByClassName("tipContent")[0].innerHTML == "获取权限中...") {
                return
            }
            getPermission()
        })
        isLogin()
        changeActiveBtn()
 
    }
    main()
})();